import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import ".//CelebretiesBoxes.module.css";
function CelebretiesBox(props) {
  return (
    <div className="celebBoxes">
      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" src={props.myCelebData.imageAdress} />
        <Card.Body>
          <Card.Title>
            <h3>{props.myCelebData.celebName}</h3>
            <h6>Birth: {props.myCelebData.date}</h6>
            <h6>Height: {props.myCelebData.height}</h6>
          </Card.Title>
          <Card.Text></Card.Text>
          <Button variant="primary">Learn more</Button>
        </Card.Body>
      </Card>
    </div>
  );
}

export default CelebretiesBox;
